import React from "react";
import { Link } from "react-router-dom";

const blogContent = [
  {
    img: "post-1",
    cat: "Product",
    date: "Dec 15, 2021",
    title: "Review product BWIBvvv",
  },
  {
    img: "post-2",
    cat: "Inspiration",
    date: "Dec 7, 2021",
    title: "Contrast in Brand Design",
  },
  {
    img: "post-3",
    cat: "Community",
    date: "Dec 7, 2021",
    title: "The evolution of Swiss style in Interaction Design",
  },
  {
    img: "post-4",
    cat: "Product",
    date: "Dec 15, 2021",
    title: "Site inspiration with Swiss style",
  },
  {
    img: "post-5",
    cat: "Inspiration",
    date: "Dec 7, 2021",
    title: "Minimalist Trends",
  },
  {
    img: "post-6",
    cat: "Community",
    date: "Dec 7, 2021",
    title: "Design Trends - Stage 14",
  },
  {
    img: "post-7",
    cat: "Product",
    date: "Dec 15, 2021",
    title: "Business Card, small but the most important",
  },
  {
    img: "post-8",
    cat: "Inspiration",
    date: "Dec 7, 2021",
    title: "The role of leader in teamwork",
  },
  {
    img: "post-9",
    cat: "Community",
    date: "Dec 7, 2021",
    title: "Simple Logos Collection",
  },
];

const BlogThree = () => {
  return (
    <>
      {blogContent.map((val,_index) => {
        return (
          <div className="col-xl-4 col-lg-4" key={2}>
            <article className="ptf-post ptf-post--style-1">
              <div className="ptf-post__media">
                <Link className="ptf-work__link" to="/blog-details"></Link>
                <img
                  src={`assets/img/blog/grid/${val.img}.png`}
                  alt="blog"
                  loading="lazy" />
              </div>
              <div className="ptf-post__content">
                <header className="ptf-post__header">
                  <div className="ptf-post__meta">
                    <span className="cat">{val.cat}</span>
                    <span className="date">{val.date}</span>
                  </div>
                  <h3 className="ptf-post__title">
                    <Link to="/">{val.title}</Link>
                  </h3>
                </header>
              </div>
            </article>
          </div>
        );
      })}
    </>
  );
};

export default BlogThree;
